import { Component } from 'react';
import QuickSearchBox from './QuickSearchBox';

class QuickSearches extends Component {
    render() {
        return(
            <>
                 <div className="container mb-5">
                    <div className="quickSearchOptions">
                        <h1 className="quickSearchHeader row">Quick Search</h1>
                        <h4 className="quickSearchSubHeader row">Discover restaurants by type of meal</h4>
                    </div>
                    <div className="row">
                        <QuickSearchBox imageSrc={require('../Images/breakfast.jpg').default} heading="Breakfast"/>
                        <QuickSearchBox imageSrc={require('../Images/lunch.jpg').default} heading="Lunch"/>
                        <QuickSearchBox imageSrc={require('../Images/dinner.png').default} heading="Dinner"/>
                        <QuickSearchBox imageSrc={require('../Images/snacks.jpg').default} heading="Snacks"/>
                        <QuickSearchBox imageSrc={require('../Images/drinks.png').default} heading="Drinks"/>
                        <QuickSearchBox imageSrc={require('../Images/nightlife.png').default} heading="Nightlife"/>
                    </div>
                </div>
            </>
        );
    }
}

export default QuickSearches;
